import React from 'react';
import Header from '../components/Header';
import Footer from '../components/Footer';

const Cart = () => {
  return (
    <div>
      <Header />
      <h1>Ваша Корзина</h1>
      <p>Здесь будет отображаться содержимое вашей корзины. Пока что корзина пуста.</p>
      <Footer />
    </div>
  );
};

export default Cart;
